import { Admin, Resource, ShowGuesser, DataProvider } from "react-admin";
import jsonServerProvider from "ra-data-json-server";
import { UserList, UserEdit } from "./components/users";
//import simpleRestProvider from 'ra-data-simple-rest';

interface Applicant{
  id: number,
  name: string
}

const apiUrl = 'https://se-diva-docs.herokuapp.com';
fetch(apiUrl)
  .then((response: Response) => response.json())
  .then((data: Applicant[]) => {
    console.log(data);
  })
  .catch((error: Error) => {
    console.error(error);
  });


const dataProvider: DataProvider = {
    getList: async (resource: string, params: any) => {
      const { page, perPage } = params.pagination;
      const { field, order } = params.sort;
      const url = `https://se-diva-docs.herokuapp.com${resource}?_page=${page}&_limit=${perPage}&_sort=${field}&_order=${order}`;
      const response = await fetch(url);
      const totalCount = parseInt(response.headers.get('X-Total-Count') || '0', 10);
      const data = await response.json();
      return {
        data: data as Applicant[],
        total: totalCount
      };
    },
    // Implement other methods as needed
};

const App = () => (
  <Admin dataProvider={dataProvider}>
    <Resource name="applicants/view" list={UserList} edit={UserEdit} show={ShowGuesser}/>
  </Admin>
);



export default App;
